  \"2016-07-27T23:05:03.730228\",\n\t\"name\": \"results-of-the-aquatic-monitoring-program-in-streams-at-the-rocky-flats-site-golden-2001-2\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"An aquatic monitoring program was initiated
  in the summer 200 I at the Rocky Flats EnvironmentalTechnology Site (Rocky Flats)
  in Golden, Colorado, and was conducted for the Department of Energy(DOE) Rocky Flats
  Field Office. The purpose of this program is to establish a data base to characterizethe
  existing aquatic communities and habitat conditions in the stream environments of
  Walnut, Woman, and Rock Creeks in the Buffer Zone surrounding the Industrial Area
  at the Site. Baseline surveys were conducted to document the abundance and distribution
  of fish and benthic macroinvertebrate populations and physical habitat parameters
  at selected sampling locations. Monitoring results for the 2001-2002 period are
  presented in this report. These results and additional data collected in subsequent
  years will establish a data base that can be used to monitor the potential impacts
  of ongoing closure activities through 2006 to drainages on the Site and in downstream
  areas, as well as provide a baseline for comparison with post-closure years. After
  closure, the Site will be turned over to the U.S. Fish and Wildlife Service and
  will be called the Rocky Flats National Wildlife Refuge.\",\n\t\"license_title\":
